import React, { useEffect, useState } from 'react'
import CursorFollwer from './CursorFollwer'

const InsectGenrator = () => {

    const [genrateImg, setGenrateImg] = useState([])
    const [position, setPosition] = useState()
    const img = [
        "data:image/jpeg;base64,",
        "data:image/jpeg;base64,",
        "data:image/jpeg;base64,",
        "data:image/jpeg;base64,",
        "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT-VimcUbRoWObIcqbcCLPcuhzFbX3UDgmJig&s"
    ]

    function imgHendler() {
        const newImg = Math.floor(Math.random() * img.length)
        const newPosition = Math.floor(Math.random() * 50)
        const newArr = img[newImg]
        setPosition(newPosition)
        setGenrateImg(newArr)
    }
    return (
        <div className='md:flex'>
            <CursorFollwer />

            <div className='md:w-1/2'>
                <div className=' text-4xl p-7 absolute  uppercase font-bold text-black flex gap-7'>
                    <h5>6.<span>&#x29;</span></h5>
                    <h1 className=''>Color Genrator</h1>
                </div>
                <div onClick={imgHendler} className='w-full   relative h-screen'>
                    {genrateImg.length === 0 ? null : <img className='w-40 z-50 h-40 object-cover absolute' src={genrateImg}
                        style={{
                            left: `${position}%`,
                            bottom: `${position}%`,
                        }}
                        alt="" />}
                    <button className='uppercase font-semibold absolute bottom-10 py-10 text-3xl w-full' >click anywere to gernate Buterfly.</button>
                </div>
            </div>
        </div>
    )
}

export default InsectGenrator
